import './App.css';
import AlienClockApp from './components/app';


function App() {
  return (
    <div className="App">
      <header className="App-header">
          ReactDOM.render(<AlienClockApp />, document.getElementById("root"));
      </header>
    </div>
  );
}

export default App;
